function setClassNotNull() {
  const emailInput = document.getElementById('emailInput');
  const errorSymbol = document.getElementById('errorSymbol');
  const errorText = document.getElementById('emailInput');

  if (emailInput.className === 'emailInput') emailInput.setAttribute('class', 'emailInput -notNull');
  if (errorSymbol.className === 'errorSymbol -disabled') errorSymbol.setAttribute('class', 'errorSymbol');
  if (errorText.className === 'errorText -disabled') errorText.setAttribute('class', 'errorText');
}

export default setClassNotNull;
